
public class SwitchClass {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i = 4;
		
		switch(i)
		
		{
		
		case 4:
		
			System.out.println("Four");
			break;
		
			case 6:
			
				System.out.println("Six");
			break;
		
			default:
				System.out.println("No Match found");
			
		}
		

	}

}
